Summary:
Uncle Grandpa is a magical uncle and grandpa to everyone, and he travels around the world in an RV on a mission to help people in any way they may need it. The mustachioed good Samaritan wears a fanny pack, named Belly Bag, that serves as his right-hand man as he finds solutions to everyday situations -- even if no issue existed to begin with. Also helping Uncle Grandpa on his adventures are dinosaur Mr. Gus, talking pizza slice Pizza Steve, and Giant Realistic Flying Tiger, their primary mode of transportation. Eternally optimistic Uncle Grandpa always greets the day, and everyone he meets, with a signature &quot;Good mornin'!&quot;

